import React from "react";
import { useNavigate } from "react-router-dom";

const ManagerPage = () =>{
    const navigate = useNavigate();

   return(
    <React.Fragment>
         <div className="navbar">
            <Link to="/" className="links">Task Management System</Link>
           
            <a href="#about" className="links">About Us</a>
           
            <a href="#contact" className="links">Contact</a>
       
            <Link to ="/managerRegister" className ="links" onClick={(()=><ManagerRegister/>)}>RegisterManager</Link>
            <Link to ="/addProject" className ="links" onClick={handleProjectClick}>AddProject</Link>
            <Link to ="/allProjects" className ="links" onClick={()=>{setShowEmployeeTable(false); setShowManagerTable(false); setShowProjectTable(true)}}>AllProjects</Link>
            <Link to ="/viewManager" className ="links" onClick ={()=>{setShowManagerTable(true); setShowEmployeeTable(false);setShowProjectTable(false)}}>ViewManager</Link>
            <Link to ="/viewAllEmployees" className ="links" onClick={()=>{setShowEmployeeTable(true); setShowManagerTable(false);setShowProjectTable(false)}}>ViewAllEmployees</Link>
            <Link to="/changePassword" className="links">ChangPassword</Link>
            <Link to="/logout" className="links">Logout</Link>
        </div>
    </React.Fragment>
   )

}

export default ManagerPage;
